import React from "react";
import "./Home.css";

function Home() {
  return (
    <div
      className="hero"
      style={{ backgroundImage: "url('/images/bg1.jpg')" }}
    >
      <h1>Welcome to MediQ</h1>
      <p>Your trusted pharmacy partner</p>
    </div>
  );
}

export default Home;
